import React from 'react';
import { Chart } from "react-google-charts";
import Loader from "../reusableComponents/Loader";
const JirasChart=(props)=>{


    let view=null;
    view=this.props.jiraData.map()

    return(
        <div >
            <Chart
                width={'250px'}
                height={'200px'}
                chartType="BarChart"
                loader={<Loader/>}
                data={[
                    ['Jiras','Count'],
                    ['SWIFT-5920', 4],
                    ['SWIFT-10632', 3],
                    ['SWIFT-8530', 2],
                    ['SWIFT-8559', 2],
                    ['SWIFT-10330', 1],
                ]}
                options={{
                    color:'red',
                    title: 'Jira count in presented cycles',
                    chartArea: { width: '40%' },
                    hAxis: {

                        minValue: 0,
                    },
                    vAxis: {

                    },
                }}
                // For tests
                rootProps={{ 'data-testid': '1' }}
            />

        </div>
    )
};

export default JirasChart;
